-- Тест 013: Ограничение длины запроса (MAX_QUERY_TEXT_LENGTH)
-- Этот тест проверяет корректность обрезания слишком длинных запросов
-- MAX_QUERY_TEXT_LENGTH = 512Kb

-- Тестируем ограничение длины запроса
WITH CTE AS (
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                UNION ALL
                SELECT
                    ''
                LIMIT 1
            )
SELECT
    CASE
        WHEN LENGTH(query_text) <= 524288 + 15
            THEN 'OK - длина в пределах лимита'
        ELSE 'ERROR - превышен лимит длины'
    END AS status
FROM pg_query_stack(0) AS T, CTE;

-- Проверяем что обычные запросы не обрезаются
SELECT
    LENGTH('_long_query') AS normal_query_length,
    CASE
        WHEN query_text LIKE '%test_long_query%'
            THEN 'OK - обычный запрос полный'
        ELSE 'ERROR - обычный запрос поврежден'
    END AS normal_query_status
FROM pg_query_stack(0)
WHERE frame_number = 0;

DISCARD ALL;
